import React from "react";
import styled from "styled-components";

const Link = styled.a`
color: red;
${(props) =>
  props.primary &&
  css`
    color: green;
  `}
`;

const NavLink = (props) => {
    return <Link>{props.children}</Link>;
};

export default NavLink;
